volatile int * audio_ptr = (int *)AUDIO_BASE;

char seg7[] = {0x3f, 0x06, 0x5b, 0x4f, 0x66, 0x6d, 0x7d, 0x07, 0x7f, 0x67, 0x77, 0x7c, 0x39, 0x5e, 0x79, 0x71, 0x00}; // define lighting for seg7 display
platform platform_arr[6];
draw draw_arr[6]; //graphic storage
audio audio_arr[10];


int nplatform;
double charX, charY; 
int charW, charH;

