int main(void)
{
    // just in case the previous did not clear pushbutton edgecap
    *(key_edgecap) = 0x0000000F;
    // initialize LEDR settings
    int itrN = 0; // char squeeze animation 
    int value = 1; // 
    int power = 0;
    int on = 0;

    // initialize game stage settings
    int gameover = 0;
	
	double Fspeed = 35.0; //frame rate
	
    double jumpx = 35; // fixed jumping position of the platform
    double jumpy = 120; // fixed jumping position of the platform
	
	charX = 147.0; //set initial character x, y position
	charY = 100.0;
	charW = 15;
	charH = 50;
	
	// initialize different type of platform (right now all using the default platform 0 data, swap when needed)
    platform_arr[0].imageWidth = 90;
    platform_arr[0].imageHeight = 80;
    platform_arr[0].platformImage = box1_90_80;

    platform_arr[1].imageWidth = 90;
    platform_arr[1].imageHeight = 80;
    platform_arr[1].platformImage = box2_90_80;

    platform_arr[2].imageWidth = 90;
    platform_arr[2].imageHeight = 80;
    platform_arr[2].platformImage = box3_90_80;

    platform_arr[3].imageWidth = 90;
    platform_arr[3].imageHeight = 80;
    platform_arr[3].platformImage = box4_90_80;

    platform_arr[4].imageWidth = 90;
    platform_arr[4].imageHeight = 80;
    platform_arr[4].platformImage = box5_90_80;

    platform_arr[5].imageWidth = 90;
    platform_arr[5].imageHeight = 80;
    platform_arr[5].platformImage = box6_90_80;
	
	// initialize different shapes of characters
	char_arr[0] = character_15_50;
	char_arr[1] = char1;
	char_arr[2] = char2;
	char_arr[3] = char3;
	char_arr[4] = char4;
	char_arr[5] = char5;


	// initialize different audio 
	//=========== experimenting with audio ===================
	//audio_arr[0].audioarr = sound_arr1;
	//audio_arr[0].audiosize = 1033;

	//audio_arr[1].audioarr = sound_arr2;
	//audio_arr[1].audiosize = 1004;

	audio_arr[2].audioarr = sound_arrlong;
	audio_arr[2].audiosize = 19584;
	
	// audio_arr[3].audioarr = sound_arr4;
	// audio_arr[3].audiosize = 1033;

	// audio_arr[4].audioarr = sound_arr5;
	// audio_arr[4].audiosize = 1149;

	// audio_arr[5].audioarr = sound_arr6;
	// audio_arr[5].audiosize = 907;

	// audio_arr[6].audioarr = sound_arr7;
	// audio_arr[6].audiosize = 1091;

	// audio_arr[7].audioarr = sound_arr8;
	// audio_arr[7].audiosize = 869;

	// audio_arr[8].audioarr = sound_arr9;
	// audio_arr[8].audiosize = 1004;

	// audio_arr[9].audioarr = sound_arr10;
	// audio_arr[9].audiosize = 1120;
	
	while(1){
		int audio_idx = 0;
		int num;
		
		for(num = 0; num < audio_arr[audio_idx].audiosize; num++){
			*(audio_ptr + 2) = (audio_arr[audio_idx].audioarr)[num*2];
			*(audio_ptr + 3) = (audio_arr[audio_idx].audioarr)[num*2+1];
		}
	}

	//=========== experimenting with audio ===================

	while(1){
		nplatform = 0;	// starting at platform 0
    	int focusidx = 0; // the idx of the platform at the jumping position - in the moving animation, only move the platfrom before the focusidx
    	int jumpcount = 0;
		
		JUMP_display();

		// front buffer draw
		*(pixel_ctrl_ptr + 1) = FPGA_ONCHIP_BASE; 
		wait_for_vsync();
		pixel_buffer_start = *pixel_ctrl_ptr;
		draw_title();
		draw obj1 = {0, 110.0, 120.0};
		draw_arr[0] = obj1;
		nplatform = 1;
		draw_array();
		draw_char(0);//draw character
		
		// back buffer draw
		*(pixel_ctrl_ptr + 1) = SDRAM_BASE;
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
		clear_screen();
		draw_array();
		draw_char(0);//draw character
		

		//title loop (should only be in this stage once)
		int edgestatus;
		edgestatus = *(key_edgecap);

		while((edgestatus & 0x0001) == 0){
			// if key0 is not pressed, keep pulling the edge trigger value
			edgestatus = *(key_edgecap);
		}
		*(key_edgecap) = 0x0000000F; // clear edge trigger for later IO device pulling
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		VGA_text_clean();
		// if add title animation, added it here
		/*
			TITLE ANIMATION CODE
		*/
		clear_screen();// clear the screen black
		// game start animation (should only show once)
		double xdiff = (jumpx - draw_arr[focusidx].x)/Fspeed;
		double ydiff = (jumpy - draw_arr[focusidx].y)/Fspeed;
		//block 2 animation prep
		double rand_dis = (double)random_distance(170,70);
		//int rand_dis = 67;
		double falldis = 200.0/Fspeed;
		
		// slant is y=cx (slope) by which we get y coord 
		double fally = jumpy-rand_dis*slant;
		double inity2 = 0;
		if(fally - falldis*Fspeed > 0.0){
			inity2 = fally - falldis * Fspeed;
		}
		draw obj2 = {random_distance(6,0), jumpx+rand_dis, inity2};
		draw_arr[1] = obj2;
		nplatform += 1;

		int i, j;	
		for(i = 0; i<Fspeed; i++){
			
			//block 1
			clear_char();
			clear_draw_array();
			for(j =0; j<=focusidx; j++){
				if((draw_arr[j].x + xdiff) >=0.0 &&(draw_arr[j].y + ydiff) <=(239.0-platform_arr[draw_arr[j].platformIdx].imageHeight)){
					draw_arr[j].x += xdiff;
					draw_arr[j].y += ydiff;
				}
			}

			charX += xdiff;
			charY += ydiff;
			
			//block 2
			if((fally-falldis * (Fspeed-1.0-i))>=0.0){
				draw_arr[focusidx+1].y = fally-falldis * (Fspeed-1.0-i);
			}
			
			draw_array();
			draw_char(0);//draw character
			
			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		}
		// clear HEX display JUMP and show count
		HEX_display(jumpcount);

		//game start loop
		while(1)
		{
			if(((*key_ptr)& (0x0001))!=0){

				// if key0 is pressed
				if(value>512){
					
					gameover = 1; // testing fail flag
					
					*led_ptr = on;
					if(on==0){
						on = 1023;
					}else{
						on = 0;
					}
				}else {
					// read the audio port fifospace register
					//=========== experimenting with audio ===================
					//int audio_idx = 1;
					//int num;
					//for(num = 0; num < audio_arr[audio_idx].audiosize; num++){
					//	*(audio_ptr + 2) = (audio_arr[audio_idx].audioarr)[num*2];
					//	*(audio_ptr + 3) = (audio_arr[audio_idx].audioarr)[num*2+1];
					//}
					//=========== experimenting with audio ===================
					power += value;
					*led_ptr = power;
					value = value * 2; // shifting the bits to create power accumulation animation on LEDR
				}
				clear_char();
				clear_draw_array();
				draw_array();
				
				if(itrN<=9){
					draw_char(itrN/2+1);//draw character
				}else{
					draw_char(5);
				}
				itrN += 1;
				//clear_screen();
				
			}else{
				itrN = 0;
				value = 1;
				power = 0;
				*led_ptr = 0;
				edgestatus = *(key_edgecap);
				if((edgestatus & 0x0001) == 0){
					//waiting for user to press key0 here
					clear_screen(); // user clear_screen to create the drag here
				}else{
					// user just finished their pressing input to the game
					*(key_edgecap) = 0x0000000F;
					// do jump animation here
					
					double a = -2.5; 
					
					// offset -10 otherwise off block when shift
					double total_x =  draw_arr[focusidx+1].x - jumpx - 10;
					double total_y = jumpy - draw_arr[focusidx+1].y;
					//float total_x =  draw_arr[focusidx+1].x - charX;
					//float total_y = charY - draw_arr[focusidx+1].y;
					
					double total_t = Fspeed;
					
					double init_velocity_x = total_x/total_t; 
					double init_velocity_y = (total_y - (0.5*a*total_t*total_t))/total_t; // y = y0 + v0yt + 0.5gt^2
					
					double init_char_x = charX;
					double init_char_y = charY;
					
					int t;
					for(t = 1; t <= Fspeed; t++){
						clear_char();
						clear_draw_array();
						
						// displacement relative to starting position
						double distx = init_velocity_x*t; 
						double disty = (init_velocity_y*t) + (0.5*a*t*t);
						
						charX = init_char_x + distx; 
						charY = init_char_y - disty;
						
						draw_array();
						draw_char(0);
						
						wait_for_vsync();
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
					}
					
					if(gameover){
						charX = 147.0; //set initial character x, y position
						charY = 100.0;
						gameover=0;
						break;
					}

					// following a platforms moving animation
					
					focusidx += 1;
					double xdiff = (jumpx - draw_arr[focusidx].x)/Fspeed;
					double ydiff = (jumpy - draw_arr[focusidx].y)/Fspeed;
					
					//block 2 animation prep
					
					double rand_dis = (double)random_distance(170,70);
					//rand_dis = 50; //for testing purpose
					double beginx = jumpx+rand_dis+(draw_arr[focusidx].x-jumpx);
					double beginy = jumpy-rand_dis * slant-(jumpy-draw_arr[focusidx].y);
					draw obj = {random_distance(6,0), beginx, beginy};
					//check if block2 in visible screen, if so float instead of suddenly shows
					int floatup = 0;
					double floatdis = 0;
					if(beginx>(0-platform_arr[obj.platformIdx].imageWidth)&&
					beginx<319 && beginy <239 &&
					beginy>=(0-platform_arr[obj.platformIdx].imageHeight)){
						floatup = 1;
						obj.y = 239.0;
						obj.x = jumpx+rand_dis;
						floatdis = (jumpy-rand_dis * slant - 239.0)/Fspeed;
					}
				
					draw_arr[nplatform] = obj;
					nplatform += 1;
					int shift = 0;
					int i, j;
					for(i = 0; i<Fspeed; i++){
						if(shift ==1){
							clear_screen();
							shift = 0;
						}
						//block 1
						clear_char();
						clear_draw_array();
						for(j =0; j<=focusidx;++j){
							if((draw_arr[j].x + xdiff) >
							(0-platform_arr[draw_arr[j].platformIdx].imageWidth)&&(draw_arr[j].x + xdiff) <=319&&
							(draw_arr[j].y + ydiff) <=(239)
							&&(draw_arr[j].y + ydiff)>=(0-platform_arr[draw_arr[j].platformIdx].imageHeight)){
								draw_arr[j].x += xdiff;
								draw_arr[j].y += ydiff;
							}else{
								shift = 1;
								continue;
							}
						}
						
						// shift char too
						charX += xdiff;
						charY += ydiff;
						
						// block 2
						if(floatup){
							draw_arr[focusidx+1].y += floatdis;
						}else{
							draw_arr[focusidx+1].x += xdiff;
							draw_arr[focusidx+1].y += ydiff;
						}
						if(shift == 1){
							shift_draw();
							nplatform -= 1;
							focusidx -= 1;
						}
						draw_array();
						draw_char(0);//draw character
						wait_for_vsync(); // swap front and back buffers on VGA vertical sync
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
						
					}
				// if sucessful, update jump count
				jumpcount += 1;
				HEX_display(jumpcount);
				}
				clear_screen();
				draw_array();
				draw_char(0);//draw character
				//clear_screen();
			}
			//check press at every active drawing cycle



			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		}
	}
}

void wait_for_vsync(){
    volatile int* pixel_ctrl_ptr = (int *)0xFF203020;
    register int status;

    *pixel_ctrl_ptr = 1; // start the synchronization process
    status = *(pixel_ctrl_ptr + 3);

    while((status & 0x01) != 0){
        status = *(pixel_ctrl_ptr + 3);
    }

}

void draw_title(){
	VGA_text_clean();
	char title_text[]= "Press Key0 to start game";
	clear_screen();
	//plot_image(110, 120, image_box_100_83, 100, 83);
	plot_image(50, 5, image_title_210_70, 210, 70);
	VGA_text(28, 20, title_text);
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


void clear_screen(){
	int i, j;
    for(i = 0; i <= 319; i++){
        for(j = 0; j <240;j++){
            plot_pixel(i, j, 0x0);
        }
    }
}

void VGA_text_clean() {
    /* assume that the text string fits on one line */
    for(int y=0;y<60;y++){
        for(int x=0;x<80;x++){
            int offset = (y << 7) + x;
            *(character_buffer + offset) = 0;
            ++offset;
        }
    }
}

void plot_image(int initialX, int initialY, int imageArray[], unsigned width, unsigned height) {

    int i = 0; // index for pixel colours in the image array
	unsigned y, x;
    for (y = 0; y < height; y++) {
        for (x = 0; x < width; x++) {
            int plotX = initialX + x;
            int plotY = initialY + y;

            // check for magenta, which is selected as a substitute of the alpha(transparent) colour
            // when the pixel is out of bound, ignore it
            if (imageArray[i] != 0x0000 && plotX >= 0 && plotY >= 0 && plotX < 320 && plotY < 240)
                plot_pixel(plotX, plotY, imageArray[i]);

            i++; // switch to the next pixel colour
        }
    }
}

// subroutine for plotting text on the screen
void VGA_text(int x, int y, char *text_ptr) {
    /* assume that the text string fits on one line */
    int offset = (y << 7) + x;

    while (*(text_ptr)) // while it hasn't reach the null-terminating char in the string
    {
        // write to the character buffer
        *(character_buffer + offset) = *(text_ptr);
        ++text_ptr;
        ++offset;
    }
}

void shift_draw(){
	int i;
	for(i = 0; i<nplatform-1;i++){
		draw_arr[i] = draw_arr[i+1];
	}	
}

int random_distance(int high, int low){
    //higher bound is 184, and lower bound is 0
    return (rand() %(high - low)) + low;
}
						
void clear_draw_array(){
	int k, idx;
	double x, y;
	
	for(k=0; k<nplatform;k++){
		idx = draw_arr[k].platformIdx;
		x = draw_arr[k].x;
		y = draw_arr[k].y;
		draw_box((int)x, (int)y, platform_arr[idx].imageWidth,
				 platform_arr[idx].imageHeight, 0x0000);
	}
}

void clear_char(){
	draw_box((int)charX-10, (int)charY-25, 50, 100, 0x0000);
}

void draw_array(){
    int idx;
	double x, y;
	int i;
    for(i = nplatform-1; i>=0;i--){
        idx = draw_arr[i].platformIdx;
        x = draw_arr[i].x;
        y = draw_arr[i].y;
        plot_image((int)x, (int)y, platform_arr[idx].platformImage,
                   platform_arr[idx].imageWidth, platform_arr[idx].imageHeight);

    }
}

void draw_char(int idx){
    plot_image((int)charX, (int)charY, char_arr[idx], charW, charH);
}

void draw_box(int x, int y, int width, int height, short int col){
	int i, j;
	for(i = x-10; i < x+width+30; i++){
		for(j = y-30; j < y+height+20; j++){
			if(i>=0&&i<320&&j>=0&&j<240){
				plot_pixel(i, j, col);}
		}
	}
}

void HEX_display(int value){
	//value = 2;
	int thousand = value/1000;
	int hundred = (value-1000*thousand)/100;
	int ten = (value-1000*thousand-100*hundred)/10;
	int one = (value-1000*thousand-100*hundred-10*ten);
	if(!thousand){ thousand = 16;}
	if(!hundred){ hundred = 16;}
	if(!ten){ ten = 16;}
	
	
	*(HEX5_4_ptr) = 0x00;
	*(HEX3_0_ptr) = seg7[one] | seg7[ten] << 8 | seg7[hundred] << 16|  seg7[thousand] << 24;
}

void JUMP_display(){
	//value = 2;
	*(HEX5_4_ptr) = (0x1F);
	*(HEX3_0_ptr) = (0x73) | (0x27) << 8|  (0x33) << 16 |(0x3E) << 24;
}

